 regards,</p>\r\n<p class=\\"xxxmsonormal\\" style=\\"margin: 0cm; font-size: 11pt; font-family: Calibri, sans-serif; caret-color: #000000; text-size-adjust: auto;\\">&nbsp;</p>\r\n<p class=\\"xxxmsonormal\\" style=\\"margin: 0cm; font-size: 11pt; font-family: Calibri, sans-serif; caret-color: #000000; text-size-adjust: auto;\\">Sanju</p>", "welcome"=>"<p class=\\"MsoNormal\\" style=\\"margin: 0cm; font-size: 10pt; font-family: Calibri, sans-serif; caret-color: #000000; text-size-adjust: auto;\\"><span lang=\\"EN-US\\" style=\\"font-size: 12pt; font-family: Verdana, sans-serif;\\">Dear {{municipality}}<span class=\\"Apple-converted-space\\">&nbsp;</span>Accommodators:</span></p>\r\n<p class=\\"MsoNormal\\" style=\\"margin: 0cm; font-size: 10pt; font-family: Calibri, sans-serif; caret-color: #000000; text-size-adjust: auto;\\"><span lang=\\"EN-US\\" style=\\"font-size: 12pt; font-family: Verdana, sans-serif;\\">&nbsp;</span></p>\r\n<p class=\\"MsoNormal\\" style=\\"margin: 0cm; font-size: 10pt; font-family: Calibri, sans-serif; caret-color: #000000; text-size-adjust: auto;\\"><span lang=\\"EN-US\\" style=\\"font-size: 12pt; font-family: Verdana, sans-serif;\\">We are very pleased to welcome you to the Municipal Accommodation Tax (MAT) online reporting tool and website for your city.</span></p>\r\n<p class=\\"MsoNormal\\" style=\\"margin: 0cm; font-size: 10pt; font-family: Calibri, sans-serif; caret-color: #000000; text-size-adjust: auto;\\"><span lang=\\"EN-US\\" style=\\"font-size: 12pt; font-family: Verdana, sans-serif;\\">&nbsp;</span></p>\r\n<p class=\\"MsoNormal\\" style=\\"margin: 0cm; font-size: 10pt; font-family: Calibri, sans-serif; caret-color: #000000; text-size-adjust: auto;\\"><span lang=\\"EN-US\\" style=\\"font-size: 12pt; font-family: Verdana, sans-serif;\\">Please click the link below to register and start reporting your [Monthly/Quarterly] data.</span></p>\r\n<p class=\\"MsoNormal\\" style=\\"margin: 0cm; font-size: 10pt; font-family: Calibri, sans-